import AppLayout from '../components/AppLayout';

const Home = () => {
return (
  <>
    <Head>
      <title>StarLive</title>
      <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.19.8/antd.css"/>
      <script src="https://cdnjs.cloudflare.com/ajax/libs/antd/3.19.8/antd.js"/>
      </Head>
      <AppLayout>
        <Link href="/about"><a>about</a></Link>
        <div>hello, next!</div>
        </AppLayout>
    </>
 );
};

export default Home;
